    const submit = e => {
      alert("ahhh");
      e.preventDefault()
      //fetch : mettre URL serveur
      fetch('/api', {
        method: 'POST',
        body: JSON.stringify({ data }),
        //body : JSON.stringify({ data }),
        headers: { 'Content-Type': 'application/json' },
      })
        .then(res => res.json())
        //.then(json => setUser(json.user))
    }
  
    return (
      <form onSubmit={submit}>
